import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation';
import Header from './components/Header/Header';
import CreateFields from './components/CreateFields/CreateFields';
import "tachyons";
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
    input: '',
    addPercentField: '',
    box: {},
    route: 'signin',
    isSignedIn: false,
    user: {
        id: '',
        name: '',
        email: '',
        entries: 0,
        joined: ''
    }
    }
  }

  onPercentCreate = () => {
    this.setState({addPercentField: this.state.addPercentField});
  }

  render() {
    return (
      <div>
        <Navigation />
        <Header />
        <CreateFields />
      </div>
    )
  }  
}


export default App;
